import react from "react";
import styled from "styled-components";
import CharacterRollDisplay from "./ChracterRollDIsplay";

const primaryColor = "#662d91";
const secondaryColor = "#252525";

const Container = styled.div`
  width: 100%;
  background-color: teal;
`;

const SkillContainer = styled.div`
  width: 100%;
  display: flex;
`;

const SkillBox = styled.div`
  height: 25px;
  background-color: yellow;
`;

const IsPro = styled.div`
  width: 10px;
  height: 10px;
  border: 1px solid;
`;

const Skills = ({ skills }) => {
  console.log(skills);
  return (
    <Container>
      <SkillContainer>
        <SkillBox>{skills[0].name}</SkillBox>
        <SkillBox>{skills[0].mod}</SkillBox>
        <SkillBox>{skills[0].bonus}</SkillBox>
      </SkillContainer>
    </Container>
  );
};

export default Skills;
